import axiosClient from "../api/axiosClient";

const AppService = {
    getImage: async (imgName) => {
        const url = `${process.env.REACT_APP_BASE_URL}/public/files/${imgName}`;
        const data = await axiosClient.get(url);
        return data;
    }
}
export default AppService;
